import React, { useState } from 'react';
import { useLocation, useNavigate, Link } from 'react-router-dom';
import AboutMe from './AboutMe';
import Address from './Address';
import BirthDate from './BirthDate';
import { getAssignedComponents } from '../helpers/componentUtils';
import './Page2.css';

const Page2 = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { user } = location.state || {};
  const assignedComponents = getAssignedComponents('page2');

  // State for form data
  const [aboutMeText, setAboutMeText] = useState('');
  const [address, setAddress] = useState({
    street: '',
    city: '',
    state: '',
    zip: ''
  });
  const [selectedYear, setSelectedYear] = useState('');
  const [selectedMonth, setSelectedMonth] = useState('');
  const [selectedDay, setSelectedDay] = useState('');
  const [message, setMessage] = useState('');

  const handleLogout = () => {
    navigate('/');
  };

  const handleSubmit = async () => {
    try {
      // First save profile data
      const profileResponse = await fetch('http://localhost:8080/api/save-profile', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({
          user_id: user.id,
          about_me: aboutMeText,
          street: address.street,
          city: address.city,
          state: address.state,
          zip_code: address.zip,
          birth_year: selectedYear,
          birth_month: selectedMonth,
          birth_day: selectedDay
        })
      });

      const profileResult = await profileResponse.json();
      if (!profileResponse.ok) throw new Error(profileResult.error || 'Failed to save profile');

      // Then navigate to login
      navigate('/');
    } catch (error) {
      setMessage(error.message);
    }
  };

  const renderComponent = (name) => {
    switch(name) {
      case 'AboutMe': 
        return <AboutMe value={aboutMeText} onChange={setAboutMeText} />;
      case 'Address': 
        return <Address value={address} onChange={setAddress} />;
      case 'BirthDate': 
        return <BirthDate 
          year={selectedYear} 
          month={selectedMonth} 
          day={selectedDay}
          onYearChange={setSelectedYear}
          onMonthChange={setSelectedMonth}
          onDayChange={setSelectedDay}
        />;
      default: return null;
    }
  };

  return (
    <div className="page2-container">
      <h1>Welcome to Page 2</h1>
      {user && (
        <div className="user-info">
          <p>Logged in as: <strong>{user.email}</strong></p>
        </div>
      )}
      {message && <div className="message">{message}</div>}
      <div className="page2-content">
        {assignedComponents.map(component => (
          <div key={component} className="component-wrapper">
            {renderComponent(component)}
          </div>
        ))}
        <div className="button-group">
          <button onClick={handleLogout} className="logout-button">
            Logout
          </button>
          <button onClick={handleSubmit} className="submit-button">
            Submit
          </button>
          <Link to="/page1" state={{ user }} className="nav-button">
            Back to Page 1
          </Link>
          {user?.email === 'admin@example.com' && (
            <Link to="/admin" className="admin-button">
              Admin Panel
            </Link>
          )}
        </div>
      </div>
    </div>
  );
};

export default Page2;
